const ImageLinkForm = () => {
	return (
		<div className='ma4 mt0'>
			<p className='f3'>
			 {'The Magic Brain will detect faces in your pictures.'}
			</p>
			<div>
				<input />
				<button />
			</div>
		</div>
	);
}

export default ImageLinkForm;
